contract PopcornSigmoid is Context {
    using SafeMath for uint256;
    // Make sure the paymentToken with decimal 18 !!
    IERC20 paymentToken;
    uint256 paymentTokenDecimalFactor=1;  
    // For USDT where decimal=6 
    // paymentTokenDecimalFactor 1e18.div(1e6) = 1e12
    // For BUSD where decimal=18
    // paymentTokenDecimalFactor 1e18.div(1e18) = 1
    uint256 maxTotalSupply = 20e22;
    uint256 priceCap = 48e17;
    uint256 supplyShift = SafeMath.mul(60, 1e18).div(10);
    uint256 slopeFactor = 12e18;
    IERC20Minter popcornToken;
    // popcornToken 1e18.div(1e18) = 1, so no factor needed
    address recyclePool;

    constructor(address _paymentToken, address _popcornToken, address _recyclePool) {
        paymentToken = IERC20(_paymentToken);
        popcornToken = IERC20Minter(_popcornToken);
        recyclePool = _recyclePool;
    }

    // price: 1 -> 1e18
    //TODO change into internal
    function _priceGivenSupply(uint256 _totalSupply) public view returns (uint256) {
        uint256 log2 = _totalSupply.mul(slopeFactor).div(maxTotalSupply);

        uint256 denominator = PRBMathUD60x18.exp(1e19) + PRBMathUD60x18.exp(supplyShift.add(1e19).sub(log2));
        uint256 numerator = PRBMathUD60x18.mul(priceCap, PRBMathUD60x18.exp(1e19));
        return PRBMathUD60x18.div(numerator, denominator);
    }

    function priceGivenSupply() public view returns (uint256) {
        return _priceGivenSupply(popcornToken.totalSupply());
    }

    // return PRBMathUD60x18 style of area
    //TODO change into internal
    function _areaGivenSupply(uint256 _totalSupply) public view returns (uint256) {
        uint256 _startOffsetPartial = PRBMathUD60x18.ln(1e18 + PRBMathUD60x18.div(PRBMathUD60x18.exp(_totalSupply.mul(slopeFactor).div(maxTotalSupply)), PRBMathUD60x18.exp(supplyShift)));
        return PRBMathUD60x18.div(PRBMathUD60x18.mul(PRBMathUD60x18.mul(_startOffsetPartial, maxTotalSupply), priceCap), slopeFactor);
    }

    function areaGivenSupply() public view returns (uint256) {
        return _areaGivenSupply(popcornToken.totalSupply()).sub(_areaGivenSupply(0));
    }

    function swapPaymentForPopcorn(uint256 popcornAmount) public {
        uint256 price = _priceGivenSupply(popcornToken.totalSupply().add(popcornAmount));
        paymentToken.transferFrom(_msgSender(), address(this), price.mul(popcornAmount).div(1e18).div(paymentTokenDecimalFactor));
        popcornToken.mint(_msgSender(), popcornAmount);
    }

    function swapPopcornForPayment(uint256 popcornAmount) public {
        uint256 price = _priceGivenSupply(popcornToken.totalSupply().sub(popcornAmount));
        paymentToken.transfer( _msgSender(), price.mul(popcornAmount).div(1e18).div(paymentTokenDecimalFactor));
        popcornToken.transferFrom(_msgSender(), address(this), popcornAmount);
        popcornToken.burn(popcornAmount);
    }

    function clearOutExtraReward() public {
        require(_msgSender()==recyclePool, "Only Recycle Pool");
        uint256 recycleAmount = paymentToken.balanceOf(address(this)).mul(paymentTokenDecimalFactor).sub(areaGivenSupply());
        paymentToken.transfer(_msgSender(), recycleAmount.div(paymentTokenDecimalFactor));
    }

    // Get estimate of popcornAmount parameter for swapPaymentForPopcorn given target paymentAmount
    function swapPaymentForPopcornGivenPayment(uint256 paymentAmount) public view returns (uint256) {
        // transfer paymentAmount into 1e18 style
        paymentAmount = paymentAmount.mul(paymentTokenDecimalFactor);
        // At most this amount of popcorn to be minted 
        uint256 _upperBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply()));
        // At leaset this amount of popcorn to be minted (safe)
        uint256 _lowerBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply().add(_upperBond)));

        // New upperBond given lowerBond
        _upperBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply().add(_lowerBond)));
        // New lowerBond given upperBond, stop here, no need to further recursive operation
        _lowerBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply().add(_upperBond)));
        return _lowerBond;
    }

    // Get estimate of popcornAmount parameter for swapPopcornForPayment given target paymentAmount
    function swapPopcornForPaymentGivenPayment(uint256 paymentAmount) public view returns (uint256) {
         // transfer paymentAmount into 1e18 style
        paymentAmount = paymentAmount.mul(paymentTokenDecimalFactor);
        // At most this amount of popcorn to be burned 
        uint256 _upperBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply()));
        // At leaset this amount of popcorn to be burned (safe)
        uint256 _lowerBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply().sub(_upperBond)));

        // New upperBond given lowerBond
        _upperBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply().sub(_lowerBond)));
        // New lowerBond given upperBond, stop here, no need to further recursive operation
        _lowerBond = paymentAmount.mul(1e18).div(_priceGivenSupply(popcornToken.totalSupply().sub(_upperBond)));
        return _lowerBond;
    }

    // View the paymentToke amount to be paid by user given target popcornAmount
    function swapPaymentForPopcornGivenPopcorn(uint256 popcornAmount) public view returns (uint256) {
        uint256 price = _priceGivenSupply(popcornToken.totalSupply().add(popcornAmount));
        return price.mul(popcornAmount).div(1e18).div(paymentTokenDecimalFactor);
    }

    // View the paymentToke amount to be paid by user given target popcornAmount
    function swapPopcornForPaymentGivenPopcorn(uint256 popcornAmount) public view returns (uint256) {
        uint256 price = _priceGivenSupply(popcornToken.totalSupply().sub(popcornAmount));
        return price.mul(popcornAmount).div(1e18).div(paymentTokenDecimalFactor);
    }
}

